import React, { useState, useEffect, useRef } from "react";
import { Link, useNavigate } from "react-router-dom";
import { UserState } from "../context/UserProvider";
import otpImg from "../utils/oottpp.png";
import axios from "axios";
import CountDown from "./CountDown";
import { toast } from "react-toastify";

const Otp = () => {
  const { token, setUser } = UserState();
  const navigate = useNavigate();

  const validateOTPbutton = useRef();

  const [verifying, setVerifying] = useState(false);
  const [userOTP, setUserOTP] = useState("");
  const [checkOTP, setCheckOTP] = useState(false);

  useEffect(() => {
    window.addEventListener("beforeunload", handleBeforeUnload);
    return () => {
      window.removeEventListener("beforeunload", handleBeforeUnload);
    };
  }, []);

  const handleVerification = async (e) => {
    setVerifying(true);
    if (e) {
      e.preventDefault();
    }
    console.log("Sending OTP");

    let config = {
      headers: {
        Authorization: "Bearer " + token,
        withCredentials: true,
      },
    };

    await axios
      .get(`http://localhost:5000/user/get-otp`, config)
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
        setVerifying(false);
        setUserOTP("");
        setCheckOTP(false);
      });
  };

  const handleBeforeUnload = (e) => {
    e.preventDefault();
    const message =
      "Are you sure you want to leave? All provided data will be lost.";
    e.returnValue = message;
    return message;
  };

  const verifyOTP = async (e) => {
    e.preventDefault();
    setCheckOTP(!checkOTP);
    validateOTPbutton.current.innerText = "VERIFYING OTP";
    if (userOTP) {
      console.log("Verifying OTP", userOTP);

      let config = {
        headers: {
          Authorization: "Bearer " + token,
          withCredentials: true,
        },
      };

      await axios
        .post(`http://localhost:5000/user/verify-otp`, { otp: userOTP }, config)
        .then((res) => {
          console.log(res.data);
          if (res.data && res.data.user) {
            let updatedUser = res.data.user;
            toast.success("Email verified");
            console.log(updatedUser);
            setUser(updatedUser);
            navigate('/leader-board');
          }
        })
        .catch((err) => {
          console.log(err);
          setVerifying(false);
          setUserOTP("");
          setCheckOTP(false);
          validateOTPbutton.current.innerText = "INVALID";
          navigate(-1);
        });
    }
  };

  return (
    <div className="w-full sm:w-10/12 max-w-md flex-1 sm:h-4/5 pb-4 mb-16 sm:mb-5 sm:rounded-lg sm:shadow-lg flex flex-col justify-start items-center bg-gradient-to-b from-orange-500 to-yellow-400">
      <img
        className="h-1/3 md:h-1/4 px-5 ml-10 sm:ml-4 mt-10 sm:mt-5"
        src={otpImg}
        alt="OTP Image"
      />
      <div className="w-11/12 flex-1 flex flex-col items-center p-5 sm:p-2 gap-3">
        <p className="text-3xl font-semibold text-white">Verification</p>
        <p className="text-white text-center font-light">
          You will receive an{" "}
          <span className="font-semibold underline">OTP</span> via email
        </p>

        {verifying ? (
          <CountDown
            resendOTP={handleVerification}
            setVerifying={setVerifying}
            verifying={verifying}
          />
        ) : (
          <p className="text-white text-center font-light">
            Expires in: <span className="font-semibold">00:10</span>
          </p>
        )}

        <form className="flex flex-col w-full justify-start gap-5 items-center mt-10">
          <input
            disabled={!verifying || checkOTP}
            placeholder="Enter OTP"
            type="password"
            className="w-full bg-white border border-gray-300 rounded-lg px-3 py-2 text-sm placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-yellow-400 focus:border-transparent"
            onChange={(e) => setUserOTP(e.target.value)}
          />
          <button
            disabled={checkOTP || !(userOTP.length >= 4 && verifying)}
            ref={validateOTPbutton}
            onClick={(e) => {
              verifying ? verifyOTP(e) : handleVerification(e);
            }}
            className="w-full bg-yellow-400 hover:bg-yellow-300 active:bg-yellow-500 text-white text-lg px-5 py-2 rounded-lg focus:outline-none"
          >
            {verifying ? "VERIFYING OTP" : "GET OTP"}
          </button>
        </form>
      </div>
    </div>
  );
};

export default Otp;
